  def construct_without_init():
    cls = AudioEffectNotchFilter.__new__(AudioEffectNotchFilter)
    cls.shouldBeDeleted = True
    cls.init_signals()
    return cls
  @staticmethod
  def get_type():
    return 'AudioEffectNotchFilter'

  def __del__(self):
    pass
